import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import roomService from '../../services/roomService';
import './RoomPage.css';

const RoomPage = () => {
  const { roomId } = useParams();
  const [room, setRoom] = useState(null);
  const [loading, setLoading] = useState(true);
  const [showModal, setShowModal] = useState(false);

  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [description, setDescription] = useState('');
  const [pdfFile, setPdfFile] = useState(null);

  useEffect(() => {
    const fetchRoom = async () => {
      setLoading(true);
      const data = await roomService.getRoom(roomId);
      setRoom(data);
      setLoading(false);
    };

    fetchRoom();
  }, [roomId]);

  const handleAddProfile = async () => {
    if (!name || !email || (!description && !pdfFile)) {
      alert('Please fill all fields or upload a PDF.');
      return;
    }

    const formData = new FormData();
    formData.append('RoomID', roomId);
    formData.append('name', name);
    formData.append('email', email);
    if (description) formData.append('description', description);
    if (pdfFile) formData.append('pdf', pdfFile);

    try {
      await roomService.addProfileToRoom(formData);
      setShowModal(false);
      window.location.reload(); // Reload room data
    } catch (err) {
      alert('Failed to add profile: ' + err.message);
    }
  };

  if (loading) return <div className="room-loading">Loading room data...</div>;
  if (!room) return <div className="room-error">Room not found</div>;

  const profiles = room.profiles || {};

  return (
    <div className="room-page">
      <div className="room-header">
        <h1>Room ID: {room.RoomID}</h1>
        <p>Created by: {room.creatorID}</p>
        <button className="add-profile-btn" onClick={() => setShowModal(true)}>
          + Add Profile
        </button>
      </div>

      <div className="profile-grid">
        {Object.values(profiles).map((profile, idx) => (
          <div className="profile-card" key={idx}>
            <h3>{profile.name}</h3>
            <p className="email">{profile.email}</p>
            <p className="desc">{profile.description}</p>
          </div>
        ))}
      </div>

      <div className="generate-teams-container">
        <button className="generate-teams-btn">Generate Teams</button>
      </div>

      {showModal && (
        <div className="modal-backdrop">
          <div className="modal">
            <h2>Add Researcher Profile</h2>
            <input type="text" placeholder="Name" value={name} onChange={(e) => setName(e.target.value)} />
            <input type="email" placeholder="Email" value={email} onChange={(e) => setEmail(e.target.value)} />
            <textarea
              placeholder="Researcher Description"
              value={description}
              onChange={(e) => setDescription(e.target.value)}
            />
            <input type="file" accept="application/pdf" onChange={(e) => setPdfFile(e.target.files[0])} />
            <div className="modal-buttons">
              <button onClick={handleAddProfile}>Submit</button>
              <button className="cancel" onClick={() => setShowModal(false)}>Cancel</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default RoomPage;
